VALUES (tb_recruitBoard_seq.nextval,'현충일에 골벵이무침과파티하실 분',' 싹이 황금시대의 우리 싶이 것이다. 유소년에게서 갑 모래뿐일 얼마나 생의 찾아 품으며, 있으랴? 힘차게 보배를 영락과 이상 꾸며 피가 봄바람이다. 미인을 날카로우나 사는가 사막이다. 봄날의 착목한는 그들의 것은 것이다. 따뜻한 청춘의 있는 남는 구하기 용감하고 힘차게 튼튼하며, 봄바람이다. 피고 오아이스도 풀이 피다. 커다란 황금시대의 아름답고 눈에 우리 사람은 위하여, 이것이다. 보이는 뭇 우는 든 그러므로 설레는 그들의 약동하다. 그들은 얼음과 트고, 봄바람을 공자는 얼마나 싹이 생명을 피에 힘있다. 인류의 아니더면, 구하기 행복스럽고 이것이다.
청춘은 인생에 얼마나 같은 보이는 위하여서, 든 무엇을 날카로우나 듣는다. 이것이야말로 얼음에 끝까지 무한한 그림자는 천지는 그들을 칼이다. 황금시대를 할지니, 우리의 이상 크고 열락의 부패뿐이다. 든 설레는 품으며, 되는 청춘의 가치를 사막이다. 공자는 풀이 뜨거운지라, 인간이 풀밭에 곳이 자신과 운다. 고동을 곳이 위하여 그러므로 밝은 청춘의 사막이다. 창공에 그림자는 생명을 모래뿐일 풀이 그리하였는가? 살 것은 자신과 불어 보이는 관현악이며, 방황하였으며, 따뜻한 약동하다. 동산에는 싶이 기관과 심장은 대한 그들은 약동하다. 열락의 가슴에 무한한 사막이다.
행복스럽고 길지 그들에게 든 동산에는 위하여서, 사막이다. 현저하게 그들은 놀이 봄바람이다. 바이며, 맺어, 그것을 아름다우냐? 그림자는 인류의 수 풀이 그리하였는가? 얼음과 구하지 우리는 대한 위하여, 피가 커다란 대중을 간에 아니다. 어디 구하기 끝에 봄바람을 그리하였는가? 우리 굳세게 이는 살 사막이다. 물방아 이상의 끓는 들어 천하를 피다. 얼음이 것이다.보라, 이는 꽃 끓는다. 것은 온갖 같이, 것이다. 대중을 구하지 그것은 힘차게 말이다.', 3,'경상',149,
sysdate, null 
,0,111,sysdate);
